import React, { useEffect, useState } from "react";
import { Link, useOutletContext } from "react-router-dom";


// Functional Component
const Vehicles = () => {
    const { inventoryState: [inventory, setInventory] } = useOutletContext();
    {/* This return format is to map all. */}

    return(
        <div className="logo-container">
            <div className="logo-row">
                <img className="logo-block" src="path/to/image1.jpg" alt="Logo 1" />
                <img className="logo-block" src="path/to/image2.jpg" alt="Logo 2" />
                <img className="logo-block" src="path/to/image3.jpg" alt="Logo 3" />
            </div>
            <div className="logo-column">
                <img className="logo-block" src="path/to/image4.jpg" alt="Logo 4" />
                <img className="logo-block" src="path/to/image5.jpg" alt="Logo 5" />
            </div>
        </div>
    )
};

// Export
export default Vehicles;

